class GuestController extends Controller {
    public function index(Request $request) {
        return view('guests.index'); // no $guests here, fetched by AJAX
    }

    public function live(Request $request) {
        $query = self::getUserQuery($request->user());

        if (v($search = $request->string('search')->toString())) {
            $query->where(function ($q) use ($search) {
                $q->where('name', 'like', "%$search%")
                    ->orWhere('email', 'like', "%$search%")
                    ->orWhereHas('profile.site', fn($h) => $h->where('name', 'like', "%$search%"))
                    ->orWhereHas('profile.country', fn($c) => $c->where('name_en', 'like', "%$search%"));
            });
        }

        $customers = $query->latest()->with(['profile.site', 'profile.country'])->limit(1000)->get();
        return response()->json($customers);
    }

    public static function getUserQuery($user) {
        $query = User::with(['reservations.status'])->whereHas('profile', fn($q) => $q->where('role_id', 10))
            ->with('profile');

        $profile = $user->profile ?? null;
        if ($profile && $profile->role_id == 10) {
            if ($profile->site_id) {
                // Restrict guests to same site
                $siteExternalId = optional(Site::find($profile->site_id))->external_id;
                $query->whereHas('profile', fn($p) => $p->where('site_id', $profile->site_id));
            } else {
                $query->whereRaw('0=1'); // block if no site
            }
        }

        return $query;
    }

